    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:07:33.788762",nt"name": "darwin-hc-a-tool-to-predict-hot-corrosion-of-nickel-based-turbine-disks-project",nt"isopen":
    true,nt"url": null,nt"notes": "Hot Corrosion of turbine engine components
    has been studied for manynyears.  The underlying mechan-isms of Type I Hot Corrosion
    and Type IInHot Corrosion are increasingly well-understood.  Nickel-basednsuperalloys
    have shown strong resistance to high temperature oxidationnattack and, of course,
    excellent high temperature strength.  Modernnturbine engine designs that seek to
    achieve better fuel efficiency innpart by increasing turbine inlet temperatures
    are strong candidates fornnickel-based superalloy turbine disk materials.  As disk
    temperaturesnapproach 700C, designers must consider the likelihood and effects ofnType
    II corrosion.  Type II corrosion is typically characterized bynlocalized corrosion
    pitting caused by melting of sulfur-containingnsalts.  Type II hot corrosion pits
    have been shown to decrease thenfatigue resistance of superalloys due to initiation
    of fatigue cracks atnhot corrosion pits.  However, the rigorous analytical models
    and toolsnneeded by turbine engine designers to predict Type II corrosion pitnformation
    and fatigue life degradation due to corrosion pits are notncurrently available.
      Barron Associates, Inc. and its research partnersnpropose to develop corrosion
    pitting and fatigue life models fornnickel-based superalloys subjected to Type II
    hot corrosion.  The modelsnwill be commercia-lized and made available to the research
    andndevelopment community.",nt"license_title": "U.S. Government Work",nt"extras":
